import { render } from '@testing-library/react';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default class AppBar extends React.Component {
        render(){

            const Menu = props => (
                <div id="appBar">                    
                    <div>
                    <Link to='/'>
                        <h1>Wdemy</h1>
                    </Link>
                    </div>                  
                </div>
            )
            return (
                <>
                <div id="menu">
                    <Menu />
                </div>
                </>
            )
        }

}
